import './Preview.css';

function Preview({product: {productType, productName, productDesc, price, priceReduced}}) {
    return (
        <main>
            <p>{productType}</p>

            <h1>{productName}</h1>

            <p>{productDesc}</p>
            <p>{price}</p>
            <p>{priceReduced}</p>

            <p>Add to Cart</p>
        </main>
    );
}

export default Preview;
